import React, { Component, Fragment } from "react";
import Header from "./components/Header";
import PersonalSalud from "./components/PersonalSalud";

/*import Home from "./components/Home";*/

class App extends Component {
  render() {
    return (
      <Fragment>
      <div>
        <div class="container-fluid row" style="padding-top: 30px">
          <h4 class="mb-4">Agregar nuevo caso <a class="btn text-white" style="background-color: #0796d8;" href="#!"
                                                role="button">
              <i class="fas fa-plus"></i>
          </a></h4>
        </div>
      </div>
        <Header />
        <PersonalSalud />
      </Fragment>
    );
  }
}

export default App;
